import React, { Component } from 'react';
import Layout from '../containers/Layout';

class IndexPage extends Component {
  state = {
    user: null
  }

  render() {
    return (
      <Layout>
      <div>
        <p>sdf!</p>
      </div>
    </Layout>
    );
  }
}

export default IndexPage;
